Spartacus (Marcus London) is captured and made to fight to the death in the arena. After surviving the onslaught, he is sold to the Ludis of Batiatus (Tony de Sergio) where he is thrust into a world of sex and violence. He finds an unlikely ally in fellow slave Crixus (Tommy Gunn), as they are both expected to please Lucretia (Devon Lee). In addition to performing in depraved orgies, they must train to fight against the unbeaten giant Androcoles. Will they fall victim to the gladiator or will they prove victorious and earn their freedom? A sexual epic for the ages!
